pragma solidity >=0.4.21 <0.6.0;

import './Person.sol';
import './Interaction.sol';


contract Patient is Person {

  enum Events {
    WRITE_CODE_SET,
    PAYMENT_CODE_SET,
    CODES_SET,
    READ_ACCESS_SET,
    WRITE_ACCESS_SET,
    ENTRY_ADDED,
    KEYS_FOR_DATA_SET
  }

  event OperationEvent(
    Events eventType
  );

  struct Key {
    bytes32 firstPart;
    bytes32 secondPart;
  }

  struct DoctorStruct {
    bool isAllowPermanentAccessToRead;
    bool isAllowPermanentAccessToWrite;
    bytes32[] secret;
    Key writeAccessCode;
    Key paymentCode;
    uint8 paymentTries;
  }

  bytes32[] encryptedPrivateKey;
  bool isEncryptedPrivateKeySet = false;

  address[] private doctorsAddresses;
  bytes32[] private history;

  mapping(address => DoctorStruct) doctors;
  mapping(address => bool) knownDoctors;

  constructor(address _owner, address _interactionContractAddress) public Person(_owner, _interactionContractAddress) {
  }

  modifier onlyDoctorInContract(address _doctor) {
    if (knownDoctors[_doctor] == true) _;
  }

  modifier onlyDoctorsWithReadPermanentAccess() {
    if (doctors[msg.sender].isAllowPermanentAccessToRead == true) _;
  }

  function addDoctor(address _doctor) internal {
    Key memory writeAccessCode = Key(0, 0);
    Key memory paymentCode = Key(0, 0);
    bytes32[] memory secret;

    DoctorStruct memory doctor = DoctorStruct(false, false, secret, writeAccessCode, paymentCode, 3);
    doctors[_doctor] = doctor;
    knownDoctors[_doctor] = true;
    doctorsAddresses.push(_doctor);
  }

  function setDoctorWriteCode(address _doctor, bytes32 _codeFirstPart, bytes32 _codeSecondPart) public onlyOwner {
    if (knownDoctors[_doctor] == false) {
      addDoctor(_doctor);
    }
    doctors[_doctor].writeAccessCode.firstPart = _codeFirstPart;
    doctors[_doctor].writeAccessCode.secondPart = _codeSecondPart;
    emit OperationEvent(Events.WRITE_CODE_SET);
  }

  function setPaymentCode(address _doctor, bytes32 _codeFirstPart, bytes32 _codeSecondPart) public onlyOwner {
    if (knownDoctors[_doctor] == false) {
      addDoctor(_doctor);
    }
    doctors[_doctor].paymentCode.firstPart = _codeFirstPart;
    doctors[_doctor].paymentCode.secondPart = _codeSecondPart;
    doctors[_doctor].paymentTries = 3;
    emit OperationEvent(Events.PAYMENT_CODE_SET);
  }

  function checkPaymentCode(
    address _doctor,
    bytes32 _codeFirstPart,
    bytes32 _codeSecondPart) external onlyDoctorInContract(_doctor) returns(bool) {
    if (doctors[_doctor].paymentTries == 0) {
      // emit event to user that doctor tries to get money but with wrong code
      interactionContract.emitPaymentTriesLimitEvent(owner, _doctor);
      return false;
    }
    if (doctors[_doctor].paymentCode.firstPart == _codeFirstPart && doctors[_doctor].paymentCode.secondPart == _codeSecondPart) {
      doctors[_doctor].paymentCode.firstPart = 0;
      doctors[_doctor].paymentCode.secondPart = 0;
      return true;
    } else {
      doctors[_doctor].paymentTries--;
      return false;
    }
  }

  function setCodes(
    address _doctor,
    bytes32 _writeAccessCodeFirstPart,
    bytes32 _writeAccessCodeSecondPart,
    bytes32 _paymentCodeFirstPart,
    bytes32 _paymentCodeSecondPart) public onlyOwner {

    if (knownDoctors[_doctor] == false) {
      addDoctor(_doctor);
    }
    doctors[_doctor].writeAccessCode.firstPart = _writeAccessCodeFirstPart;
    doctors[_doctor].writeAccessCode.secondPart = _writeAccessCodeSecondPart;

    doctors[_doctor].paymentCode.firstPart = _paymentCodeFirstPart;
    doctors[_doctor].paymentCode.secondPart = _paymentCodeSecondPart;

    emit OperationEvent(Events.CODES_SET);
  }

  function getDoctors() public view onlyOwner returns(address[] memory) {
    return doctorsAddresses;
  }

  function setDoctorPermanentAccessRead(address _doctor, bytes32[] memory _secret) public onlyOwner {
    if (knownDoctors[_doctor] == false) {
      addDoctor(_doctor);
    }
    doctors[_doctor].isAllowPermanentAccessToRead = true;
    doctors[_doctor].secret = _secret;
    emit OperationEvent(Events.READ_ACCESS_SET);
  }

  function setDoctorPermanentAccessWrite(address _doctor, bool _isAllowed) public onlyOwner {
    if (knownDoctors[_doctor] == false) {
      addDoctor(_doctor);
    }
    doctors[_doctor].isAllowPermanentAccessToWrite = _isAllowed;
    emit OperationEvent(Events.WRITE_ACCESS_SET);
  }

  // doctors with permanent address can use this function
  function getHistoryForDoctor() public onlyDoctorsWithReadPermanentAccess view returns (bytes32[] memory) {
    return history;
  }

  // retreiving user history for owner
  function getHistory() external onlyOwner view returns (bytes32[] memory) {
    return history;
  }

  function isDoctorHavePermanentWriteAccess(address _doctor) public view returns(bool) {
    return doctors[_doctor].isAllowPermanentAccessToWrite;
  }

  function getDoctorKey(address _doctor) public view returns(bytes32) {
    return doctors[_doctor].paymentCode.firstPart;
  }

  // doctor calls this method from interaction contract and if he has permanent access
  // to the the histrory, he can add it immediatly
  // if doesnt then event on adding request is sent to the user to approve such action
  function addEntryRequest(
    address _doctor,
    bytes32[] memory _entry,
    bytes32 _codeFirstPart,
    bytes32 _codeSecondPart) public onlyDoctorInContract(_doctor) returns (bool) {
      if (msg.sender == owner) {
        return false;
      }

      Key memory key = doctors[_doctor].writeAccessCode;

      if (doctors[_doctor].isAllowPermanentAccessToWrite == true ||
      (_codeFirstPart != 0 && _codeSecondPart != 0 && key.firstPart == _codeFirstPart && key.secondPart == _codeSecondPart)) {

        addEntry(_entry);
        doctors[_doctor].writeAccessCode.firstPart = 0;
        doctors[_doctor].writeAccessCode.secondPart = 0;
        return true;
      }  else {
        return false;
      }
  }

  // if user is agreed on add entry request then user adds this entry to the contract by his own
  function addEntryRequest(bytes32[] memory _entry) public onlyOwner {
    addEntry(_entry);
    emit OperationEvent(Events.ENTRY_ADDED);
  }

  function addEntry(bytes32[] memory _entry) internal {
    for (uint i = 0; i < _entry.length; i++) {
      history.push(_entry[i]);
    }
  }

  function setKeys(
    bytes32[] memory _encryptedPrivateKey) public onlyOwner {
    if (isEncryptedPrivateKeySet == false) {
      encryptedPrivateKey = _encryptedPrivateKey;
      isEncryptedPrivateKeySet = true;
      emit OperationEvent(Events.KEYS_FOR_DATA_SET);
    }
  }

  // getter for encrypted data decryption key
  // this key is encrypted by owner account public key
  function getEncryptedPrivateKey() public view returns (bytes32[] memory) {
    return encryptedPrivateKey;
  }
}
